(1273, '<p><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">&nbsp;</span><span style=\"font-size:36px\">​​​​​​​&nbsp;</span></span><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">&nbsp; test big help</span></span></p>', '<p><span style=\"font-size:16px\">&nbsp;</span><span style=\"font-size:36px\">&nbsp;</span><span style=\"font-size:20px\">​​​​​​​&nbsp;</span><span style=\"font-size:14px\">​​​​​​​&nbsp;</span><span style=\"font-size:20px\">​​​​​​​&nbsp;</span></p>\n\n<p><span style=\"background-color:white\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#1f1f1f\">Il business di realizzare dei check-up online per le aziende &egrave; basato sull&#39;idea che le aziende, di qualsiasi dimensione, hanno bisogno di un&#39;analisi approfondita della propria situazione per identificare le aree di criticit&agrave; e le opportunit&agrave; di miglioramento.</span></span></span></span></p>\n\n<p><span style=\"background-color:white\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#1f1f1f\">Il check-up online &egrave; uno strumento efficace per raggiungere questo obiettivo. Si tratta di un&#39;analisi strutturata che viene condotta online, in modo da essere accessibile a qualsiasi azienda, anche a quelle con risorse limitate.</span></span></span></span></p>\n\n<p><span style=\"background-color:white\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:#1f1f1f\">Il check-up online pu&ograve; essere personalizzato in base alle esigenze specifiche dell&#39;azienda. Ad esempio, pu&ograve; concentrarsi su una o pi&ugrave; aree specifiche, come la strategia aziendale, la gestione finanziaria, la produzione, le vendite o il marketing.</span></span></span></span></p>\n\n<p><span style=\"background-color:white\"><span style=\"font